INSERT INTO `eb_article` VALUES ('34', '2,3,5', '服务器什么配置？', 'hour', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '阿里云服务器共享4G，8GB，带宽5MB，硬盘100GB', '', '', '0', '0', '', '1', '1526703318', '0', '1', '0', '0', '1'), ('36', '10', '第三篇文章', 'honor', '/public/uploads/wechat/image/20180601/5b10a27cbc7fc.jpg', '第三篇文章', '', '', '8', '0', '', '0', '1527768962', '0', '1', '0', '0', '0'), ('38', '', '第三篇文章', 'honor', '/public/uploads/wechat/image/20180601/5b10a27cbc7fc.jpg', '第三篇文章', '', '', '0', '0', '', '0', '1528257719', '0', '1', '0', '0', '0'), ('37', '0', '测试发布文章1', 'honor', '/public/uploads/wechat/image/20180606/5b17448d1f54e.jpg', '三大放送', '', '', '0', '0', '', '0', '1528251546', '0', '1', '0', '0', '0'), ('39', '2', '第三篇文章', 'honor', '/public/uploads/wechat/image/20180601/5b10a27cbc7fc.jpg', '第三篇文章', '', '', '0', '0', '', '0', '1528257728', '0', '1', '0', '0', '0'), ('40', '2', '第三篇文章', 'honor', '/public/uploads/wechat/image/20180601/5b10a27cbc7fc.jpg', '第三篇文章', '', '', '0', '0', '', '0', '1528257775', '0', '1', '0', '0', '0'), ('41', '2', '第三篇文章', 'honor', '/public/uploads/wechat/image/20180601/5b10a27cbc7fc.jpg', '第三篇文章', '', '', '0', '0', '', '0', '1528257782', '0', '1', '0', '0', '0'), ('44', '4', '还有其它什么收费项目吗？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '第二年有个维护费，最低1500元，包含服务器、域名、和技术维护服务', '', '', '3', '0', '', '1', '1533116410', '0', '1', '0', '1', '1'), ('45', '4', '维护都包含什么？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '平台保证24小时正常运行，数据天天备份，日常程序安全检测等', '', '', '5', '0', '', '1', '1533116481', '0', '1', '0', '0', '1'), ('46', '4', '这个开发多少钱？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '具体费用需要当面详细沟通您的需求，我们技术部会根据您的需求来进行详细的报价的', '', '', '0', '0', '', '0', '1533116550', '0', '1', '0', '0', '0'), ('47', '4', '开发需要多长时间？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '这个我估计不出来时间，这个需要技术部来估计时间，根据您的功能大概需要20个工作日吧？时间根据