', '1', '1533117779', '0', '1', '0', '0', '0'), ('56', '4', '假如你们不做了程序维护怎么办？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '您这个问题有很多客户也问过，您的担心我能理解，但是目前我们有好几百的客户，每年续费也有几百个客户，虽说续费利润低，但是还是有利润的，如果我们不做了，我们这块维护我们可以打包卖给另一个公司，绝对很好找接手的公司的，这样我们所有的客户都交给他了，他就有更多案例了，是很有价值的', '', '', '0', '0', '', '1', '1533118003', '0', '1', '0', '0', '0'), ('57', '4', '你们用的是什么服务器？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '我们有很多服务器，大部分都是阿里云的，也有百度云、腾讯云服务器', '', '', '0', '0', '', '1', '1533118112', '0', '1', '0', '1', '0'), ('58', '4', '你们目前合作过哪些企业？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '这个就很多了，例如西安市电影公司（电影统计系统）、陕西红牛（做活动2016年服务了一年）、金牛乳业、西电集团、陕西粮农等800多个客户了', '', '', '4', '0', '', '1', '1533118372', '0', '1', '0', '0', '0'), ('59', '4', '目前客户中有哪些做的比较好的？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '这个有很多例如：化验无忧、康牌茶叶、茯茶小镇等', '', '', '6', '0', '', '1', '1533118532', '0', '1', '0', '0', '0'), ('60', '4', '你们公司哪一年成立的？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '2014年初，四年多了', '', '', '6', '0', '', '1', '1533118591', '0', '1', '0', '0', '0'), ('61', '4', '提供源码吗？', 'honor', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '提供的', '', '', '0', '0', '', '1', '1533181962', '0', '1', '0', '0', '0'), ('62', '', '微信支付主体需要和小程序主体一致吗？', '众邦小秘', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '必须是主体一致的', '', '', '0', '0', '', '1', '1533286263', '0', '16', '0', '0', '0'), ('63', '5', '一般微信支付开通需要多久？', '众邦小秘', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '1-5个工作日...', '', '', '0', '0', '', '1', '1533286305', '0', '16', '0', '0', '0'), ('64', '5', '微信支付商户填写结算账户找不到开户银行的处理方法', '众邦小秘', 'http://shop.crmeb.net/public/uploads/0/20180802/5b62dd0adf147.jpg', '微信支付商户申请填写结算账户时如果找不到所在的银行，请选择“其他银行”后手动填写所在支行全称，例如：建设银行郑州市中兴路支行。', '', '', '0', '0', '', '1', '1533286339', '0', '16', '0', '