就不要发了，这个是根据您的需求定制开发的，技术没有任何问题，到时候我们UI会先给您设计整套流程页面的，页面满意后我们前端会开始制作页面，技术同时开始搭建后台进行开发，然后我们内部测试完成之后你们再内测，然后上下公测，上线时间段我们技术会高度关注您这个项目的</p>'), ('49', '<p>这个签订合同后，我会整理详细的需求文档和技术部开项目启动会的，我建见一个微信群，把我们客服项目经理、UI、前端、相关技术和您这边对接的负责人拉入群里面，随时保持沟通，UI会先设计效果图您这边审核提出意见，页面确认后就会交给前端和后端技术人员进行开发，在内测功能没问题后上线运营</p>'), ('50', '<p>公司规定合同签订后预付50%定金，内测完成后再付40%，上线一周后没什么问题再付尾款10%，您是问付款方式吗？对公打款、或者我们公司法人银卡卡、公司支付宝、微信都可以的？</p>'), ('51', '<p>我们公司在大兴东路，龙湖MOCO国际</p>'), ('52', '<p>我们公司是2014年处成立的，做了4年多了</p>'), ('53', '<p>我们公司目前做的项目单一，人不多将近20人，基本上都是技术，业务人员很少</p>'), ('54', '<p>公司现在不做APP项目了，我们专门做微信公众号和小程序开发，之前也是什么都做，慢慢公司业务开始精简了，只做自己最擅长的领域</p>'), ('55', '<p>可以开票，您是需要普通增值税发票还是专用增值税发票（一般纳税人企业才会要专用增值税发票）</p>'), ('56', '<p>您这个问题有很多客户也问过，您的担心我能理解，但是目前我们有好几百的客户，每年续费也有几百个客户，虽说续费利润低，但是还是有利润的，如果我们不做了，我们这块维护我们可以打包卖给另一个公司，绝对很好找接手的公司的，这样我们所有的客户都交给他了，他就有更多案例了，是很有价值的</p>'), ('57', '<p>我们有很多服务器，大部分都是阿里云的，也有百度云、腾讯云服务器，因为阿里云服务器目前是国内做的最好的，最稳定、最安全、最大的好处就是可以随时升级服务器配置，就不用担心突然用户了过大服务器扛不住了</p>'), ('58', '<p>这个就很多了，例如西安市电影公司（电影统计系统）、陕西红牛（做活动2016年服务了一年）、金牛乳业、西电集团、陕西粮农等800多个客户了</p>'), ('59', '<p>这个有很多例如：化验无忧、康牌茶叶、茯茶小镇等</p>'), ('60', '<p>2014年初，四年多了</p>'), ('61', '<p>提供的</p>'), ('62', '<p><strong><span style=\"font-family: 黑体;font-size: 14pxfont-family:黑体\">必须是主体一致的</span></strong></p><p><br/></p>'), ('63', '<p><span style=\";font-family:黑体;font-size:14px\">1-5个工作日</span></p><p><br/></p>'), ('64', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">微信支付商户申请填写结算账户时如果找不到所在的银行，请选择</span>“其他银行”后手动填写所在支行全称，例如：建设银行郑州市中兴路支行。</span></p><p><br/></p>'), ('65', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">审核中暂不支持修改，审核通过后会以邮件的形式通知</span></p><p><br/></p>'), ('66', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">暂不支持加急处理</span></p><p><br/></p>'), ('67', '<p><img src=\"/./public/uploads/editor/20180803/5b641850e26cd.png\"/></p>'), ('68', '<p><img src=\"/./public/uploads/editor/20180803/5b6418895a11f.png\"/></p>'), ('69', '<p><span style=\";font-family:黑体;font-size:14px\">①、同一个邮箱只能申请注册1个小程序；</span></p><p><span style=\";font-family:黑体;font-size:14px\">②、个人和个体工商户可以注册5个公众号（服务号+订阅号+小程序）</span></p><p><span style=\";font-family:黑体;font-size:14px\">③、企业资质可以注册50个公众号（服务号+订阅号+小程序）</span></p><p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">温馨提示：目前支持中国内地手机号码、身份证、营业执照、组织机构代码（不包括港澳台），其它国家暂不支持。</span></p><p><br/></p>'), ('70', '<p><span style=\";font-family:黑体;font-size:14px\">①、可以更换管理员，登陆小程序后台→用户身份→修改</span></p><p><span style=\";font-family:黑体;font-size:14px\">②、主体信息暂不支持更改</span></p><p><img src=\"/./public/uploads/editor/20180803/5b6419193b14e.png\"/></p>'), ('71', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登录微信公众平台</span>→客服消息→点击添加</span></p><p><img src=\"/./public/uploads/editor/20180803/5b6419637e098.png\"/></p>'), ('72', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">小程序的名称是唯一的，因此在注册过程中，若系统检测到已有帐号使用该名称，页面会出现提示：名字已被占用。</span></p><p><br/></p>'), ('73', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">若名称被占用，可以通过侵权投诉的方式对占用名称的帐号进行投诉，在侵权投诉页面提供名称使用权后，腾讯公司会有专人进行审核，侵权投诉成功后，该名称会被释放，即可申请使用。</span></p><p><br/></p>'), ('74', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">同一主体可以使用同一个名称</span></p><p><br/></p>'), ('75', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">微信公众平台申请微信认证，需支付</span>300元/次认证费。</span></p><p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">温馨提示：若小程序微信认证失败，认证费费不予退还，通知中心会提示您补填资料的最后提交期限，在此期限内请您及时补填资料，详情请留意微信公众平台通知中心</span></p><p><br/></p>'), ('76', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">微信认证成功后，自认证成功之日起计算，一年内有效</span></p><p><br/></p>'), ('77', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登陆小程序后台</span>→设置→基本设置→服务类目→详情→添加服务类目</span></p><p><img src=\"/./public/uploads/editor/20180803/5b641a9a562a6.png\"/></p>'), ('78', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登陆小程序后台</span>→设置→基本设置→隐私设置</span></p><p><br/></p>'), ('79', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">可以，个人小程序与企业小程序相比除了没有微信支付和附近功能外，服务类目也与企业小程序有所不同。</span></p><p><br/></p>'), ('80', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">目前支持微信公众平台网页版客服工具进行客服回复消息的</span></p><p><br/></p>'), ('81', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">不需要，会自动同步信息</span></p><p><br/></p>'), ('82', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">可以</span>,需要重新打包下载提交审核</span></p><p><br/></p>'), ('83', '<p><span style=\";font-family:黑体;font-size:14px\">100个</span></p><p><br/></p>'), ('84', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登录小程序后台，进入开发管理，开发版本中展示已上传的代码，管理员可提交审核或是删除代码，代码审核</span>2-3个工作日完成</span></p><p><br/></p>'), ('85', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">目前不可以</span></p><p><br/></p>'), ('86', '<p><span style=\";font-family:黑体;font-size:14px\">&nbsp;微信认证时，勾选“开具发票”时，可选择“普通发票（定额发票）”或“增值税专用发票”，选择发票类型并根据页面提示填写相应资料后，腾讯公司则会开具发票，邮费由腾讯公司承担。</span></p><p><br/></p>'), ('87', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">由于认证主体变更，可能出现相关商业收入被盗取到其他企业</span>/组织的情况；同时他人关注公众号是因为它是A企业，如果突然变成B企业，也会降低平台和帐号对用户的公信力。因此，微信认证年审时，认证主体（企业/组织）全称不支持修改。</span></p><p><br/></p>'), ('88', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">在小程序后台添加位置，展示这个小程序。当用户在此地点的周围，可在微信小程序入口中</span>“附近的小程序”发现并使用小程序提供的服务。</span></p><p><br/></p>'), ('89', '<p><span style=\";font-family:黑体;font-size:14px\">&nbsp;1、地点的经营主体跟小程序帐号主体一致或相关</span></p><p><span style=\";font-family:黑体;font-size:14px\">2、能提供经营资质信息，如营业执照或组织机构代码证等</span></p><p><br/></p>'), ('90', '<p><span style=\";font-family:黑体;font-size:14px\">&nbsp;一个经营资质只能添加一个地点，一个地点只能展示一个小程序。</span></p><p><br/></p>'), ('91', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">用已认证的微信公众号，快速注册认证小程序（一个月有五个名额），无</span>300元认证费。</span></p><p><br/></p>'), ('92', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">可以，登陆公众号点击自定义菜单即可设置</span></p><p><br/></p>'), ('93', '<p><span style=\";font-family:黑体;font-size:14px\">1、已认证小程序账号可申请微信支付功能；</span></p><p><span style=\";font-family:黑体;font-size:14px\">2、已认证小程序可绑定最多20个开发者，未认证小程序可绑定最多10个开发者。</span></p><p><br/></p>'), ('94', '<p><span style=\";font-family:黑体;font-size:14px\">1、个人小程序：每年有两次机会改名字</span></p><p><span style=\";font-family:黑体;font-size:14px\">2、企业小程序：未发布的小程序在发布上线之前有两次改名机会；已发布上线的小程序改名需要支付300元认证费</span></p><p><br/></p>'), ('95', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">公众号和小程序属于同一主体，可以同名。</span></p><p><br/></p>'), ('96', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">进入商户平台（</span>pay.weixin.qq.com），点击【账户中心】-&gt;【商户信息】-&gt;【修改】</span></p><p><br/></p>'), ('97', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">不支持</span></p><p><br/></p>'), ('98', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">查看对公账户账单流水，会收到微信打款金额</span></p><p><br/></p>'), ('99', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">会以邮件形式发到你注册时填的邮箱</span></p><p><br/></p>'), ('100', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">支付到开通微信支付时绑定的商户号里面</span></p><p><br/></p>'), ('101', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">线下扫二维码，好友、群、朋友圈分享二维码，公众号关联进入等&nbsp;</span></p><p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">搜索附件小程序或者直接搜索名称</span></p><p><br/></p>'), ('102', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">微信官方有延迟，</span></p><p><br/></p>'), ('103', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">管理者与开发者</span></p><p><br/></p>'), ('104', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">可以，小程序里面搜索</span>“小程序数据助手”查看</span></p><p><br/></p>'), ('105', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">订阅号没有支付功能</span></p><p><br/></p>'), ('106', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">不能，微信会验证营业执照的地址</span></p><p><br/></p>'), ('107', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登陆微信公众平台</span>→设置→基本设置，小程序码点击下载更多尺寸，可以下载普通二维码和小程序码</span></p><p><br/></p>'), ('108', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">模板消息是用来提醒用户的</span><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">，商家管理员也会收到订单通知信息</span></p><p><br/></p>'), ('109', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登陆微信支付商户平台</span>→产品中心→我的产品→运营工具→企业付款到零钱</span></p><p><br/></p>'), ('110', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">需要开通微信支付满</span>90天，商户号有30天连续流水记录；如果没有满足这两个添加，产品中心里面则不会显示企业付款到零钱这选项</span></p><p><br/></p>'), ('111', '<p><span style=\";font-family:黑体;font-size:14pxfont-family:黑体\">这个是微信官方的门店小程序，每个公众号都可以申请一个</span></p><p><br/></p>'), ('112', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">登陆微信公众平台</span>→微信支付，可以查看一个邮箱，登陆这个邮箱可以查看绑定的商户号及密码</span></p><p><br/></p>'), ('113', '<p><img src=\"/./public/uploads/editor/20180803/5b6420cedb8ad.png\"/></p>'), ('114', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">不可以，企业类型的只能绑定对公账号，个体工商户</span> <span style=\"font-family:黑体\">只能绑定法人银行卡</span></span></p><p><br/></p>'), ('115', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">一个小程序最多可被</span>50个公众号关联</span></p><p><br/></p>'), ('116', '<p><span style=\";font-family:黑体;font-size:14px\"><span style=\"font-family:黑体\">一个公众号可以关联</span>10个同主体下的小程序+3个不同主体小程序，最多可以关联13个小程序</span></p><p><br/></p>'), ('0', '<p>我是正文1</p>'), ('142', '<p>我是正文1</p>'), ('143', '<p>我是正文2</p>'), ('144', '<p><span style=\"white-space: normal;\">测试文章</span><span style=\"white-space: normal;\">测试文章</span><span style=\"white-space: normal;\">测试文章</span><span style=\"white-space: normal;\">测试文章</span></p>'), ('145', '<p>退换货流程退换货流退换货流程程退换货流程退换货流程</p>'), ('146', '<p>退换货流程退换货流程退换货流程</p>'), ('147', '<p>退换货流程退换货流程退换货流程</p>'), ('148', '<p>11111</p>');
